INSERT INTO `product` VALUES ('1', '华熙LIVE，快手未来灯光乐园', '2018冬天国内最高质量最国际化的灯光节', '/product_img/top_ticket1.jpg', '&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;温馨提示：由于活动火爆报名人数众多；考虑到大家的安全，公司将配合政府相关部门加强安全防范措施，原决定于2017年12月24日平安夜开始时间变更至2018年1月10日举行。已经报名支付成功的顾客，票务信息依然有效；给您带来不便深表歉意。未购票顾客请忽略本提示。&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;极乐盛宴，光影时空&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;2018&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;最好的遇见是&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;华熙未来灯光游乐园&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229746848335.jpg&quot; title=&quot;1515229746848335.jpg&quot; alt=&quot;1.jpg&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;曾有人说&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;一生必须看一场光影盛宴&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;无论是源于对艺术科技的痴迷&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;还是对浪漫和美好的向往&lt;br/&gt; 所以我们来了&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;带着“华熙未来灯光游乐园”&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;只为给你奉献一场光影盛宴&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229764669584.jpg&quot; title=&quot;1515229764669584.jpg&quot; alt=&quot;2.jpg&quot;/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229771276214.jpg&quot; title=&quot;1515229771276214.jpg&quot; alt=&quot;4.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;这将是继伦敦、悉尼之后知名的世界级灯光艺术秀&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;绝对值得期待&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229789273073.jpg&quot; title=&quot;1515229789273073.jpg&quot; alt=&quot;8.jpg&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229796171243.jpg&quot; title=&quot;1515229796171243.jpg&quot; alt=&quot;9.jpg&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;当灯光艺术邂逅现代科技&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;当声、光、电缠绵交织在一起&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;什么绮丽梦幻&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;什么变化多端&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;什么宛若仙境&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;什么天上人间&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;都不再是异想天开&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229817280954.jpg&quot; title=&quot;1515229817280954.jpg&quot; alt=&quot;10.jpg&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229823331011.jpg&quot; title=&quot;1515229823331011.jpg&quot; alt=&quot;11.jpg&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;美到让你无法呼吸&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;声——婉转流淌，跌宕起伏&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;光——千变万化，不拘于形&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;色——万千斑斓，璀璨夺目&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;影——扑朔迷离，若隐若现&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family:宋体;color:black&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229837378752.jpg&quot; title=&quot;1515229837378752.jpg&quot; alt=&quot;12.jpg&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229844602231.jpg&quot; title=&quot;1515229844602231.jpg&quot; alt=&quot;13.jpg&quot;/&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family: 宋体;color:black&quot;&gt;这里的炫酷堪比京城最火爆的夜店，但又没有刺鼻的烟味儿；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family: 宋体;color:black&quot;&gt;这里的闪耀堪比世贸天阶抬头巨大的荧屏，但又多变好玩场景丰富；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family: 宋体;color:black&quot;&gt;这里的科幻堪比好莱坞大作特效，但又可互动可操控趣味横生。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family: 宋体;color:black&quot;&gt;每一款灯光的照射下，展现你的魅力；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family: 宋体;color:black&quot;&gt;每一次场景的变幻下，发现你的侧脸如此迷人；&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family: 宋体;color:black&quot;&gt;每一条光线中，留下都市生活的身影……&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family: 宋体;color:black&quot;&gt;整场秀引进大量国内外艺术家的灯光艺术装置，打造一场光与影的盛宴，强调人与灯光的互动，突出艺术与互动技术的结合，看到光，感受光，控制光的魔法。&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family:宋体;color:black&quot;&gt;Lights Photo&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family:宋体;color:black&quot;&gt;Let’s Photo&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229857843313.jpg&quot; title=&quot;1515229857843313.jpg&quot; alt=&quot;14.jpg&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20180106/1515229863944462.jpg&quot; title=&quot;1515229863944462.jpg&quot; alt=&quot;15.jpg&quot;/&gt;&lt;br/&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt; &lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;我们与众不同，所以独领风骚&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;我们的灯光不止于视觉冲击&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;它更在乎你的切身体验&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;我们注重人与光的互动&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;突初艺术与技术的完美结合&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;只是为了让你看到光、感受光、控制光&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;让你成为光的主人&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;text-align:left&quot;&gt;&lt;span style=&quot;font-family:宋体;color:black&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:black&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;我们为你而来 满心期待&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: 宋体;color:black;letter-spacing:3px&quot;&gt;2018.1.10日至2018.2.28日&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family:宋体;color:black;letter-spacing:3px&quot;&gt;华熙LIVE玛莎拉蒂馆楼上(三夫户外西侧) 不见不散&lt;/span&gt;&lt;/p&gt;', '2018.01.10 - 2018.02.28', '华熙LIVE玛莎拉蒂馆楼上(三夫户外西侧)', '50.00', '56', '1', null, null, '1', null, null, '1', '/product_img/ticket_video.mp4'), ('2', '彩色发光花(现场优惠发售)', '2018冬天国内最高质量最国际化的灯光节', '/product_img/1.pic_hd.jpg', '&lt;p style=&quot;white-space: normal;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 20px; background-color: rgb(255, 255, 0); color: rgb(255, 0, 0);&quot;&gt;温馨提示：由于活动火爆报名人数众多；考虑到大家的安全，公司将配合政府相关部门加强安全防范措施，原决定于2017年12月24日平安夜开始时间变更至2018年1月10日举行。已经报名支付成功的顾客，票务信息依然有效；给您带来不便深表歉意。未购票顾客请忽略本提示。&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;这里的炫酷堪比京城最火爆的夜店，但又没有刺鼻的烟味儿；&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;这里的闪耀堪比世贸天阶抬头巨大的荧屏，但又多变好玩场景丰富；&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;这里的科幻堪比好莱坞大作特效，但又可互动可操控趣味横生。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802074425471.jpg&quot; title=&quot;1512802074425471.jpg&quot; alt=&quot;content_img1.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802084660168.jpg&quot; title=&quot;1512802084660168.jpg&quot; alt=&quot;content_img2.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802089354954.jpg&quot; title=&quot;1512802089354954.jpg&quot; alt=&quot;content_img3.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802097288538.jpg&quot; title=&quot;1512802097288538.jpg&quot; alt=&quot;content_img4.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802102725389.jpg&quot; title=&quot;1512802102725389.jpg&quot; alt=&quot;content_img5.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802106800575.jpg&quot; title=&quot;1512802106800575.jpg&quot; alt=&quot;content_img6.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2018.01.10 - 2018.02.28', '华熙LIVE玛莎拉蒂馆楼上(三夫户外西侧)', '39.00', '100', '1', null, null, '1', null, null, '1', null), ('3', '发光波波球(现场优惠发售)', '2018冬天国内最高质量最国际化的灯光节', '/product_img/2.pic_hd.jpg', '&lt;p style=&quot;white-space: normal;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 20px; background-color: rgb(255, 255, 0); color: rgb(255, 0, 0);&quot;&gt;温馨提示：由于活动火爆报名人数众多；考虑到大家的安全，公司将配合政府相关部门加强安全防范措施，原决定于2017年12月24日平安夜开始时间变更至2018年1月10日举行。已经报名支付成功的顾客，票务信息依然有效；给您带来不便深表歉意。未购票顾客请忽略本提示。&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;这里的炫酷堪比京城最火爆的夜店，但又没有刺鼻的烟味儿；&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;这里的闪耀堪比世贸天阶抬头巨大的荧屏，但又多变好玩场景丰富；&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;这里的科幻堪比好莱坞大作特效，但又可互动可操控趣味横生。&lt;/p&gt;&lt;p style=&quot;white-space: normal;&quot;&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802191626083.jpg&quot; title=&quot;1512802191626083.jpg&quot; alt=&quot;content_img1.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802197807798.jpg&quot; title=&quot;1512802197807798.jpg&quot; alt=&quot;content_img2.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802203961690.jpg&quot; title=&quot;1512802203961690.jpg&quot; alt=&quot;content_img3.jpg&quot;/&gt;&lt;img src=&quot;http://cs.cms.joyfamliy.com:2017/ueditor/php/upload/image/20171209/1512802208938590.jpg&quot; title=&quot;1512802208938590.jpg&quot; alt=&quot;content_img4.jpg&quot;/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '2018.01.10 - 2018.02.28', '华熙LIVE玛莎拉蒂馆楼上(三夫户外西侧)', '65.00', '100', '1', null, null, '1', null, null, '1', null);
COMMIT;

-- ----------------------------
--  Table structure for `product_describe`
-- ----------------------------
DROP TABLE IF EXISTS `product_describe`;
CREATE TABLE `product_describe` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `img_id` int(11) DEFAULT NULL COMMENT '外键，关联图片表',
  `content` varchar(255) DEFAULT NULL COMMENT '外键，关联图片表',
  `delete_time` int(11) DEFAULT NULL COMMENT '状态，主要表示是否删除，也可以扩展其他状态',
  `order` int(11) NOT NULL DEFAULT '0' COMMENT '图片排序序号',
  `product_id` int(11) NOT NULL COMMENT '商品id，外键',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
--  Table structure for `product_feature`
-- ----------------------------
DROP TABLE IF EXISTS `product_feature`;
CREATE TABLE `product_feature` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `feature` varchar(255) DEFAULT '' COMMENT '详情属性名称',
  `product_id` int(11) NOT NULL COMMENT '商品id，外键',
  `delete_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
--  Table structure for `product_image`
-- ----------------------------
DROP TABLE IF EXISTS `product_image`;
CREATE TABLE `product_image` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `img_id` int(11) NOT NULL COMMENT '外键，关联图片表',
  `delete_time` int(11) DEFAULT NULL COMMENT '状态，主要表示是否删除，也可以扩展其他状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
--  Table structure for `product_property`
-- ----------------------------
DROP TABLE IF EXISTS `product_property`;
CREATE TABLE `product_property` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT '' COMMENT '详情属性名称',
  `detail` varchar(255) NOT NULL COMMENT '详情属性',
  `product_id` int(11) DEFAULT NULL COMMENT '商品id，外键',
  `course_plan_id` int(10) unsigned DEFAULT NULL COMMENT '课程ID',
  `delete_time` int(11) DEFAULT NULL,
  `update_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- ----------------------------
--  Table structure for `product_size`
-- ----------------------------
DROP TABLE IF EXISTS `product_size`;
CREATE TABLE `product_size` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
